import React from 'react';
import Navbar from '../fragments/Navbar';

function Info() {
    return (
        <div>
            <Navbar />
            <div>
                <ul>
                    <h1>[패치노트]</h1>
                    <li>2023.09.12 13:05 캐릭터 이미지 url이 없는경우 정상적으로 가입처리가 되지 않는 문제를 임시수정하였습니다.</li>
                    <li>2023.09.13 19:20 주간숙제 추가/삭제와 수익을 수정하였습니다.</li>
                    <h3>2023.09.14</h3>
                    <li>모바일 사용 불편함으로 인해 캐릭터 정렬 기능을 분리하였습니다. <br /> -> 저장 아이콘 클릭시 변경된 순서가 저장됩니다.</li>
                    <li>주간수익 계산을 수정하였습니다. <br /> -> 앞에서부터 6개의 캐릭터만 주간 수익에 포함됩니다.</li>
                </ul>
                <ul>
                    <h1>수정예정</h1>
                    <li>드래그 순서 변경 기능으로 인해 모바일로 접속시 터치할 때마다 칸들이 움직여 불편함이 있습니다. </li>
                    <li>주간숙제 관리 6캐릭 이상, 한캐릭당 3개이상 주간숙제를 추가할 시 계속해서 주간 수익이 증가됩니다.</li>
                </ul>
            </div>
        </div>
    );
}

export default Info;
